INSERT INTO db_script_string (entry, content_default, sound, type, language, emote, comment) VALUES
(2000001480,'As disciples of blood, you strive to master the very lifeforce of your enemies.',0,0,0,0,NULL),
(2000001481,'Be it by blade or incantation, blood feeds our attacks and weakens our foes.',0,0,0,0,NULL),
(2000001482,'True masters learn to make blood serve just their strength in battle.',0,0,0,0,NULL),
(2000001483,'Stripping energy from our foes, both fighting and fallen, allows us to persevere where lesser beings fall exhausted.',0,0,0,0,NULL),
(2000001484,'And every foe that falls, energy sapped and stolen, only furthers our assault.',0,0,0,0,NULL),
(2000001485,'As masters of blood, we know battle without end...',0,0,0,0,NULL),
(2000001486,'We know hunger never to be quenched...',0,0,0,0,NULL),
(2000001487,'We know power never to be overcome...',0,0,0,0,NULL),
(2000001488,'As masters of blood, we are masters of life and death itself. Against us, even hope falls drained and lifeless.',0,0,0,0,NULL);
