INSERT INTO db_script_string (entry, content_default, sound, type, language, emote, comment) VALUES
(2000001091, 'People of Stormwind! Citizens of the Alliance! Your king speaks!', 0, 1, 0, 22, NULL),
(2000001092, 'Today marks the first of many defeats for the Scourge! Death knights, once in service of the Lich King, have broken free of his grasp and formed a new alliance against his tyranny!', 0, 1, 0, 22, NULL),
(2000001093, 'You will welcome these former heroes of the Alliance and treat them with the respect that you would give to any ally of Stormwind!', 0, 1, 0, 22, NULL),
(2000001094, 'Glory to the Alliance!', 0, 1, 0, 4, NULL);
