(2000001521, 'Today marks the first of many defeats for the Scourge! Death knights, once in service of the Lich King, have broken free of his grasp and formed a new alliance against his tyranny!', 0, 1, 0, 22, NULL),
(2000001522, 'You will welcome these former heroes of the Horde and treat them with the respect that you would give any ally of Orgrimmar!', 0, 1, 0, 22, NULL),
(2000001523, 'For the Horde!', 0, 1, 0, 4, NULL);
